  <script>
   "strict";
   class Bits {
       constructor(bytes=[]) {
           this.bytes = bytes
           this.cursor = 0;
       }

       get(offset, length) {
           let v=0
           while (length > 0) {
               let start = (offset / 8) >> 0;
               let bit   = (offset % 8) >> 0;

               let bs = bit;
               let be = Math.min(8, bs+length);
               let bits = be - bit;
               //printf("start=%d bit=%d, bs=%d, be=%d, bits=%d\n", start, bit, bs, be, bits);
               v = v<<bits | this.bytes[start] >> (8 - be) & 0xff >> (8 - bits);

               offset+=bits;
               length-=bits;
           }
           return v;
       }

       length() {
           return this.bytes.length;
       }

       seek(offset) {
           this.cursor = offset
       }

       tell() {
           return this.cursor
       }

       read(bytes) {
           let b = this.bytes.slice(this.cursor, this.cursor+bytes)
           this.cursor += bytes
           return b;
       }

       readn(n) {
           return this.read(n).reduce((acc, b) => acc << 8 | b, 0)
       }

       read8()  { return this.readn(1) }
       read16() { return this.readn(2) }
       read24() { return this.readn(3) }
       read32() { return this.readn(4) }

       write(data) {
           this.bytes.splice(this.cursor, data.length, ...data)
           this.cursor += data.length
       }

       dump() {
           // this.bytes.reduce((acc,b) => { let chunk = (acc[acc.length-1] ?? []);
           //                                if (chunk.length < 16) acc[acc.length-1]=[...chunk,b] else acc.push([b]);
           //                                return acc }, [])
           return this.bytes.reduce((acc,b,i) => { let ch = Math.floor(i/16);
               acc[ch] = [...(acc[ch]??[]), b];
               return acc }, [])
                      .map(row => row.map(b => `0x${hex(b)},`).join(" ") + "\n")
                      .join('');
       }
   }

   function hex(x) {
       return x.toString(16).padStart(2,0);
   }

   let view_el = document.getElementById("view");
   let view = view_el.getContext("2d");

   function erase() {
       //view.fillStyle = "black";
       //view.fillRect(0,0, view_el.width, view_el.height);
       view.clearRect(0,0, view_el.width, view_el.height);
   }

   function draw(clut, data, width, height, bpp, start=0, stride=undefined) {
       if (stride==undefined)
           stride = width * bpp;
       else
           stride *= 8;
       erase();
       let zoom = Math.min(Math.floor(view_el.width/width), Math.floor(view_el.height/height))
       for (let y=0; y<height; y++) {
           for (let x=0; x<width; x++) {
               let pix=data.get(start*8 + y * stride + x * bpp, bpp);
               //let pix255=pix*255/(2**bpp-1);
               //view.fillStyle = `rgb(${pix255},${pix255},${pix255})`;
               view.fillStyle = `rgb(${clut[pix].r},${clut[pix].g},${clut[pix].b})`;
               view.fillRect(x*zoom, y*zoom, zoom, zoom);
           }
       }
   }

function mike_draw(clut, sprite, xo, yo) {
    console.log(sprite);
    let data = sprite.bitmap;
    let bpp = 8;
    let stride = width * bpp;
    for (let y=0; y<height; y++) {
        for (let x=0; x<width; x++) {
            let pix = data.get(y * stride + x * bpp, bpp);
            if (pix == 0)
                view.clearRect(xo+x, yo+y, 1, 1);
            else {
                view.fillStyle = `rgb(${clut[pix].r},${clut[pix].g},${clut[pix].b})`;
                view.fillRect(xo+x, yo+y, 1, 1);
            }
        }
    }
}

function unpack(data) {
       let out = new Bits()
       console.log("header")
       console.log(`  x,y?   ${data.read16()},${data.read16()}`)
       console.log(`  height ${data.read16()}`)
       console.log(`  width  ${data.read16()}`)
       let length = data.read32()
       console.log(`  length ${length} [${hex(length)}] (end:${data.tell() + length} [${hex(data.tell() + length)}])`)
       console.log(`  again x,y?   ${data.read16()},${data.read16()}`)
       console.log(`  again height ${data.read16()}`)
       console.log(`  again width  ${data.read16()}`)

       let c = 0
       let repeat;
       while (true) {
           let command = data.read(4)
           console.log(`command[${c} (${hex(data.tell())})] ${command[0]} [${hex(...command)}]`)
           if (command[0] == 0) break;
           if (command[0] == 1) // skip forward (write zeros)?
               out.write(Array(command[3]).fill(0))
           else if (command[0] == 3) // repeat the next command n times?
               repeat = command[3]
           else if (command[0] == 2) {
               let chunk = data.read(command[3]);
               let align = data.read((3 - ((command[3]-1) % 4))); // this is wrong if len == 0: -1%4 => -1 in js. yuck.
               console.log(`   chunk  ${chunk.map(b => hex(b)).join(' ')} | ${align.map(b => hex(b)).join(' ')}`);
               out.write(Array(repeat).fill(chunk).flat())
           }
           c += 1
       }

       console.log(`end @ ${hex(data.tell())}`)

       console.log(out.dump())
       return out;
   }


   function unpack2(data, want_frame=0) {
       data.seek(0);
       frame = 0;
       let out;
       while (data.tell() < data.length()) {
           console.log("header")
           console.log(`  x,y?   ${data.read16()},${data.read16()}`)
           height = data.read16()
           width = data.read16()
           console.log(`  height ${height}`)
           console.log(`  width  ${width}`)
           let length = data.read32()
           let next_frame = data.tell() + length;
           console.log(`  length ${length} [${hex(length)}] (end:${dec_and_hex(next_frame)})`)
           y1 = data.read16()
           x1 = data.read16()
           y2 = data.read16()
           x2 = data.read16()
           console.log(`  dest rect (${x1},${y1}),(${x2},${y2})`)

           if (frame != want_frame) {
               data.seek(next_frame);
               frame++;
               continue;
           }

           out = new Bits(Array(width * height).fill(0))

           c = 0
           line = -1
           while (data.tell() < data.length()) {
               let command = data.read(4)
               //console.log(`command[${c} (${hex(data.tell())})] ${command[0]} [${hex(...command)}]`)
               if (command[0] == 0) {
                   break;
               } else if (command[0] == 1) { // Line header
                   line += 1
                   let sol = line * width
                   console.log(`new line ${line} input length ${command[3]} (next input line @ ${dec_and_hex(data.tell() + command[3])})` +
                               ` output @ ${dec_and_hex(sol)} skipping ${sol - out.tell()} from ${dec_and_hex(out.tell())}`)
                   out.seek(sol)
               } else if (command[0] == 3) { // Skip forward (write zeros)?
                   console.log(`  skip ${command[3]}`)
                   out.write(Array(command[3]).fill(0))
               } else if (command[0] == 2) {
                   console.log(`  chunk length ${command[3]}`)
                   chunk = data.read(command[3])
                   let align = data.read((3 - ((command[3]-1) % 4))); // this is wrong if len == 0: -1%4 => -1 in js. yuck.
                   console.log(`    chunk  ${chunk.map(b => hex(b)).join(' ')} | ${align.map(b => hex(b)).join(' ')}`);
                   out.write(chunk)
               }
               c += 1
           }
           break;
       }

       if (!out) return 0; // No more data

       console.log(`end @ ${hex(data.tell())}`)

       console.log(out.dump())

       return { width, height, x1, y1, bitmap: out };
   }

   function dec_and_hex(o) {
       return `${o} [${hex(o)}]`
   }

   function load_clut(inc) {
       inc.read(7);
       let colors = inc.readn(1);
       let table = Array(colors);
       while (inc.tell() < inc.length()) {
           inc.read8();
           let c = inc.read8();
           table[c] = { r: inc.read16() / 65535 * 255,
                        g: inc.read16() / 65535 * 255,
                        b: inc.read16() / 65535 * 255 }
       }
       return table;
   }

   function main() {
       let el = ["width", "height", "bpp", "offset", "frame"].reduce((acc,id) => Object.assign(acc, { [id]: document.getElementById(id) }), {});

       let sprites = Object.entries({"p1_head": Player_1_Head_sprd,
                                     "p1_body": Player_1_Body_sprd,
                                     "p2_head": Player_2_Head_sprd,
                                     "p2_body": Player_2_Body_sprd,
                                     "sm_head": Smart_Enemy_Head_sprd,
                                     "sm_body": Smart_Enemy_Body_sprd,
                                     "fa_head": Fast_Enemy_Head_sprd,
                                     "fa_body": Fast_Enemy_Body_sprd,
                                     "ba_head": Basic_Enemy_Head_sprd,
          "ba_body": Basic_Enemy_Body_sprd,
          "de_head": Dead_Sprites_Head_sprd,
          "de_body": Dead_Sprites_Body_sprd,
       }).reduce((acc, [name, encoded]) => ({ ...acc, [name]: { encoded:encoded, ...unpack2(new Bits(encoded)) } }), {});

       console.log(sprites);

       let clut = load_clut(new Bits(Standard_clut));
       console.log(sprites);

       erase();
       let y_offset = 0;
       let head_sets = [11,7,7,11,7,7,11,7,7,11,7,7];
       let body_sets = [7,7,7,7,7,7,7,7];
       let dead_sets = [12,12,12,12];

       for (let s in sprites){
           let x_offset = 0;
           let sprite = sprites[s];
           console.log(sprite);

           el.width.value = `${sprite.width}`;
           el.height.value = `${sprite.height}`;
           el.bpp.value = "8";
           el.offset.value = "0";
           el.frame.value = "0";

           let width, height, bpp, offset;
           let go = (event) => {
               width = +el.width.value;
               height = +el.height.value;
               bpp = +el.bpp.value;
               offset = +el.offset.value;
               frame = +el.frame.value;
               let f=0;
               let sprite_frame = unpack2(new Bits(sprite.encoded), f)
               while (sprite_frame != 0){
                   let max_len = 7;
                   if (f >= 28 && f < 72 && s.indexOf("head") >= 0)
                       max_len = 11;
                   if (s.indexOf("de") >= 0)
                       max_len = 12;
                   //draw(clut, sprite_frame.bitmap, width, height, bpp, offset);
                   mike_draw(clut, sprite_frame, x_offset * 25, y_offset * 25);
                   f+=1;
                   sprite_frame = unpack2(new Bits(sprite.encoded), f)
                   x_offset += 1;
                   if (x_offset == max_len){
                       x_offset = 0
                       y_offset += 1;
                   }
               }
           };

           //y_offset += 1;

           Object.values(el).forEach(el => el.oninput = go);

           go();
       }

       const shortcut = (event) => {
           if (event.key == "PageUp")   event.target.value = +event.target.value + 1;
           if (event.key == "PageDown") event.target.value = +event.target.value - 1;
           if (event.key == "Home")     event.target.value = +event.target.value + 10;
           if (event.key == "End")      event.target.value = +event.target.value - 10;
           go();
           //console.log(event);
       };
       Object.values(el).forEach(el => el.onkeydown = shortcut);
   }
   window.onload=main;
